import React from 'react'
import {Tab} from 'semantic-ui-react'

class TabExampleLoading extends React.Component {
    render() {

        const panes = [
            {
                menuItem: 'Tab 1',
                render: () => <Tab.Pane loading>Tab 1 Content</Tab.Pane>,
            },
            {menuItem: 'Tab 2', render: () => <Tab.Pane>Tab 2 Content</Tab.Pane>},
        ];


        const TabExampleLoading = () => <Tab panes={panes}/>;
        return (
            <div><TabExampleLoading/></div>
        )

    }
}

export default TabExampleLoading


const panes = [
    {
        menuItem: 'Tab 1',
        render: this.props.todoList.map((todo) =>
            <Tab.Pane>
                <div>

                    <p>{todo.todo}</p>
                    <Button content='Primary' primary onClick={() => {
                        this.props.completeList(todo);
                    }}>
                        Complete
                    </Button>
                </div>
            </Tab.Pane>)
    },
    {menuItem: 'Tab 2', render: () => <Tab.Pane>Tab 2 Content</Tab.Pane>},
    {menuItem: 'Tab 3', render: () => <Tab.Pane>Tab 3 Content</Tab.Pane>},
];
